(64, 'Cocineritos Express', 'Cozinheirinhos Express', 'Little Cookers Express', 50, 2, 0, '-46888', '', '<p><span style=''color: black; mso-ansi-language: ES-AR;'' lang=''ES-AR''><strong>TÃ©cnicas operativas adquiridas:</strong> este curso estÃ¡ orientado a niÃ±os entre 8 a 15 aÃ±os como â€œcurso de veranoâ€.</span></p>\r\n<p><span style=''color: black; mso-ansi-language: ES-AR;'' lang=''ES-AR''>Los niÃ±os </span><span style=''mso-ansi-language: ES-AR;'' lang=''ES-AR''>aprenderÃ¡n a cocinar  utilizando diferentes tÃ©cnicas y materias primas, estarÃ¡n capacitados sobre nociones de Seguridad e Higiene, NutriciÃ³n, se orienta el aprendizaje al conocimiento, comprensiÃ³n y uso de proporciones, reconocimiento y utilizaciÃ³n de distintas unidades de medida (volumen, peso), conocimiento de historia de la cocina, promulgando el trabajo en grupo, permitiendo sociabilizar con sus pares y respetando las consignas.</span></p>\r\n<p> </p>', '<p><strong>TÃ©cnicas operativas adquiridas</strong>: Este curso estÃ¡ orientado para crianÃ§as de 08 a 15 anos como ''Curso de VerÃ£o''.</p>\r\n<p>As crianÃ§as aprenderÃ£o a cozinhar utilizando diferentes tÃ©cnicas e matÃ©rias-primas. EstarÃ£o capacitados com noÃ§Ã£o de nutriÃ§Ã£o e seguridade e higiene. A aprendizagem se orienta para conhecer e compreender  o uso de proporÃ§Ã£o e sistema legal de medidas, alÃ©m de conhecer a histÃ³ria da cozinha, trabalhar em grupo  o que permiti a socializaÃ§Ã£o com seus companheiros respeitando as opiniÃµes.</p>', '', '', '', '', 0, 1, '', '', '', 'Curso Corto De Cocina Para NiÃ±os', 'curso rÃ¡pido de cozinha para crianÃ§as', '', 1, 8, 6, ''),
(65, 'Cocina Argentina', 'Cozinha Argentina', 'Argentinian Cuisine', 38, 1, 0, '-88857', '', '<p><strong>TÃ©cnicas operativas adquiridas:</strong> el <span style=''mso-ansi-language: ES-AR;'' lang=''ES-AR''>curso capacitarÃ¡ a los alumnos en el conocimiento de la cultura e historia de la gastronomÃ­a Argentina, capacitÃ¡ndose en el uso de utensilios de cocina, aprendiendo las tÃ©cnicas de manipulaciÃ³n y mÃ©todos de cocciÃ³n de distintas materias primas y modo de elaboraciÃ³n de productos tÃ­picos.</span></p>\r\n<p><strong><span lang=''ES-AR''>CategorizaciÃ³n laboral: </span></strong><span style=''mso-ansi-language: ES-MX;'' lang=''ES-MX''>el alumno egresado estarÃ¡ capacitado para interpretar y realizar recetas de Cocina Argentina, a travÃ©s del uso de las tÃ©cnicas adecuadas que conlleva esta cultura sobre las tÃ©cnicas de cocciÃ³n, servicio y presentaciÃ³n de los platos tÃ­picos.</span></p>\r\n<p> </p>', '<p>TÃ©cnicas operativas adquiridas: O curso capacitarÃ¡ os alunos com conhecimento da cultura e histÃ³ria da gastronomia Argentina. Habilita para o uso de utensÃ­lios da cozinha. AprenderÃ¡ tÃ©cnicas de manipulaÃ§Ã£o e mÃ©todos de cozimento de diferentes matÃ©rias-primas, alÃ©m da elaboraÃ§Ã£o de produtos tÃ­picos.</p>', '', '', '', '', 0, 1, '', '', '', 'Curso Corto De Cocina Argentina', 'curso rÃ¡pido de cozinha argentina', '', 1, 3, 7, ''),
