(77, 'Auxiliar De Cocina', 'Auxiliar De Cozinha', 'Assistant Cook', 77, 4, 0, '-545878', '', 'Categorización laboral: El alumno egresado estará capacitado para trabajar como auxiliar de cocina, ayudando al Jefe de Cocina realizando las tareas de limpieza y conservación adecuada de carnes, pescados y aves, deshuesado de pollo, preparación de mise en place, limpieza y cortes de vegetales, elaboración de fondos, salsas, masas de pastas, guarniciones y postres sencillos.', '\r\n\r\nCategorização de trabalho: O aluno estará capacitado para trabalhar como auxiliar de cozinha, ajudante de chef de cozinha realizando tarefas de limpeza e conservação adequada de carnes, peixes e aves. Aprenderá a cortar vegetais, desossar frango, preparar caldos, massas, guarnição e sobremesas simples, além da limpeza do ambiente.\r\n', '', '\r\n\r\nEl Auxiliar de Cocina es aquel que colabora de manera directa con el cocinero, en todo el servicio. Desde preparar fondos y postres, hasta chequear el funcionamiento de heladeras y colaborar en el arreglo general de la cocina. La preparación de alimentos es una actividad que requiere seguir pasos previos a su degustación, así como de la intervención de personas que son claves en el proceso de su elaboración, como es el caso del Auxiliar de Cocina.\r\n', '\r\n\r\nO Auxiliar de Cozinha é quem trabalha diretamente com o cozinheiro auxiliando-o em todas as tarefas. O trabalho de um auxiliar de cozinha engloba a preparação de molhos e sobremesas, vistoriar o funcionamento das geladeiras, além de ajudar na organização e limpeza geral da cozinha. A preparação dos alimentos é uma atividade que precisa seguir passos prévios a sua degustação necessitando da intervenção de pessoas fundamentais no processo de elaboração que é o Auxiliar de Cozinha.\r\n', '', 0, 1, '\r\n\r\nIncorpore las bases fundamentales para desempeñarse dentro de una cocina profesional. Desde el manejo adecuado de los alimentos, hasta el mantenimiento de los utensilios. Una formación integral que le abrirá las puertas del mundo de la gastronomía.\r\n', '\r\n\r\nConheça as bases fundamentais para desempenhar-se dentro de uma cozinha profissional, desde, manejar, adequadamente, os alimentos até a manutenção dos utensílios da cozinha. Terá uma formação integral que abrirá as portas do mundo da gastronomia.\r\n', '', 'Curso Corto De Auxiliar De Cocina', 'curso rápido auxiliar da cozinha', '', 1, 4, 7, ''),
(78, 'Cocina Chifa', 'Cozinha Chifa', 'Chifa Cuisine', 34, 2, 0, '-976576', '', '<p><strong>TÃ©cnicas operativas adquiridas:</strong> el <span style=''mso-ansi-language: ES-AR;'' lang=''ES-AR''>curso capacitarÃ¡ a los alumnos en el conocimiento del correcto uso de utensilios de cocina, aplicando adecuadamente tÃ©cnicas de manipulaciÃ³n y mÃ©todos de cocciÃ³n de distintas materias primas y modo de elaboraciÃ³n de productos que se obtienen de la fusiÃ³n de la gastronomÃ­a peruana con influencia de la cultura China.</span></p>\r\n<p><strong><span lang=''ES-AR''>CategorizaciÃ³n laboral: </span></strong><span style=''mso-ansi-language: ES-MX;'' lang=''ES-MX''>el alumno egresado estarÃ¡ capacitado para interpretar y realizar recetas de Cocina Chifa, a travÃ©s del uso de las tÃ©cnicas adecuadas que conlleva esta cultura sobre las tÃ©cnicas de cocciÃ³n, servicio y presentaciÃ³n de los platos tÃ­picos.</span></p>\r\n<p> </p>', '<p><strong>TÃ©cnicas operativas adquiridas</strong>: O curso capacitarÃ¡ os alunos no conhecimento do correto uso dos utensÃ­lios de cozinha. AplicarÃ¡, adequadamente, tÃ©cnicas de manipulaÃ§Ã£o e mÃ©todos de cozimento de distintas matÃ©rias-primas, alÃ©m dos modos de elaboraÃ§Ã£o de produtos obtidos da mistura da gastronomia peruana com a influÃªncia da cultura China.</p>\r\n<p><strong>CategorizaÃ§Ã£o de trabalho</strong>: O aluno estarÃ¡ capacitado para interpretar e realizar receitas tÃ­picas da cozinha chifa. UsarÃ¡ tÃ©cnicas adequadas dessa cultura sobre cozimento, serviÃ§os e apresentaÃ§Ã£o dos pratos tÃ­picos.</p>', '', '', '', '', 0, 1, '', '', '', 'Curso Corto De Cocina Chifa', 'curso rÃ¡pido de cozinha chifa', '', 1, 3, 7, '');
