(114, 'Mesas Dulces Para Eventos', 'Mesas Doces Para Eventos', 'Tables Of Sweet Dishes', 60, 4, 0, '', '', '<p>Curso avanzado de presentaciÃ³n de Mesas Dulces para Eventos, se realizan productos de  pastelerÃ­a y decoraciones de mesas con tÃ©cnicas de vanguardia, combinando texturas, sabores y colores aplicÃ¡ndolas en presentaciones segÃºn distintos tipos de eventos.</p>', '', '', '<p>El egresado de este curso, estarÃ¡ capacitado para realizar presentaciones modernas aplicando tÃ©cnicas de manipulaciÃ³n, mÃ©todos de cocciÃ³n, administraciÃ³n y planificaciÃ³n de distintos productos de pastelerÃ­a, elaborando variedad en presentaciÃ³n de mesas dulces con diversidad  de productos acorde al evento.</p>', '', '', 0, 1, '<p>SerÃ¡s un experto en presentaciÃ³n de Mesas Dulces!! Te convertirÃ¡s en un profesional de los eventos, realizando las mejores preparaciones con diferentes texturas, sabores y colores ULTRAMODERNAS!!</p>\r\n<p> </p>', '', '', 'Curso Corto De Armado De Mesas Dulces', 'curso rÃ¡pido de mesas doces', '', 1, 5, 7, ''),
(115, 'Cata Y DegustaciÃ³n', 'Cata De Vinhos', 'Wine And Food Tasting', 4, 4, 0, '', '', '<p>Cata y degustaciÃ³n de vinos.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span>PresentaciÃ³n de la Bodega (a cargo de gente de la bodega)</span></p>\r\n<p><span>Estilo de elaboraciÃ³n de los vinos</span></p>\r\n<p><span>Cata guiada<br /></span></p>\r\n<p><span >Planillas de Cata</span></p>\r\n<p> </p>', '', '', '<p>Aprenda las diferentes variedades de vinos segÃºn las particularidades de cada Bodega.</p>', '', '', 0, 1, '<p>Cata y degustaciÃ³n de diferentes variedades de vinos.</p>', '', '', 'Seminario De Cata Y DegustaciÃ³n', 'workshop de cata de vinhos', '', 1, 0, 8, ''),
(116, 'Tallado De Frutas Y Verduras', 'Tallado De Frutas Y Verduras BÃ¡sico', 'Fruit And Vegetable Carving', 9, 0, 0, '', '', '<p>Seminario de Tallado de Frutas y Verduras. Dictado por Cristian  Carabajal. El Seminario capacita para el uso de las herramientas de tallado aplicando adecuadamente las tÃ©cnicas para la presentaciÃ³n de mesas.</p>', '', '', '<p>Seminario de Tallado de frutas y verduras, para realizar distinas piezas con frutas y verduras.</p>', '', '', 0, 1, '<p>Aprenda a utilizar las herramientas de tallado de frutas y verduras para la obtenciÃ³n de magnÃ­ficas piezas.</p>', '', '', 'Taller De Tallado De Frutas Y Verduras', '', '', 1, 0, 8, ''),
(117, 'Gestion Hotelera', 'Gestion Hotelera', 'Hotel Management', 243, 6, 0, '', '', '<p><span lang=''ES''>Preparar al alumno para dirigir RRHH o cubrir la demanda laboral de estos servicios en hoteles y empresas de turismo.</span></p>', '', '', '<p><span lang=''ES''>Preparar al alumno para el Servicio de Hospitalidad, proveerlo de todos los conocimientos para ser un emprendedor exitoso</span></p>', '', '', 0, 1, '<p><strong><span lang=''ES-AR''>CapacÃ­tese para ser excelente en la atenciÃ³n al cliente en Hoteles y Empresas de turismo.</span></strong></p>', '', '', '', '', '', 1, 0, 9, ''),
