(3, 1, '../images/slider/1/AR/ES/slider-1.jpg', 'Gastronomia y Alta Cocina', '“Gastronomía y Alta Cocina” brinda los conocimientos necesarios para alcanzar la excelencia como profesional de la gastronomía. Además obtendrás las herramientas para emprender un negocio culinario y alcanzar así la cima del éxito, haciendo de la cocina tu profesión.Convertite en un profesional de la alta cocina y del arte culinario! Encabezá un equipo de cocineros en un negocio culinario de altísimo nivel!Cursado el 1º año recibís el certificado de COCINERO PROFESIONALCursado el 2º año recibís el certificado de GASTRONOMÍA & ALTA COCINA', '../images/uniformes/1/AR/ES/uniforme.jpg', '../images/materiales/1/AR/ES/materiales.jpg', 'Con la inscripción al curso, IGA hace entrega de un uniforme completo de cocinero, compuesto por un delantal, un gorro y una chaqueta.\r\n\r\nEl alumno recibirá dos uniformes, uno para el primer año de cursado y otro para el segundo año.', 'Cada curso de IGA está respaldado por un material de estudio de primerísimo nivel y calidad, elaborado por profesionales altamente capacitados en el área de la gastronomía y la educación.\r\n\r\nEl alumno que cursa “Gastronomía y Alta Cocina” dispone de libros de excelencia; un tomo por cuatrimestre, cuatro libros en total. Los mismos contienen cada una de las materias de la currícula, incluidas las denominadas prácticas en las cuales se desarrollan las principales recetas paso a paso acompañadas de fotos full color.', '2 años de duración', 'aaaaaa'),
